      }
    };

    fetchData();
  }, [setUserId, setUserGang, setGangs, setLoading, setMessage]);


  return (
    <div>
      <h2>Gangs</h2>
      {userGang ? <GangDetails /> : <AvailableGangs />}
    </div>
  );
};

