  return { posts: state.posts };
};

export default connect(mapStateToProps, { fetchPosts })(PostsTable);
```

The `fetchPosts` action is defined as follows:

```js
export const fetchPosts = () => {
  return dispatch => {
    fetch('https://jsonplaceholder.typicode.com/posts')
      .then(response => response.json())
      .then(data => dispatch({ type: 'FETCH_POSTS_SUCCESS', payload: data }));
  };
};
```

In the Redux store, I have the following reducer:

```js
const initialState = {
  posts: []
};

const postsReducer = (state = initialState, action) => {
  switch (action.type) {
    case 'FETCH_POSTS_SUCCESS':
      return { ...state, posts: action.payload };
    default:
      return state;
  }
};

export default postsReducer;
```

When I run the application, the table remains empty, and there are no error messages in the console. I've tried debugging by adding console logs in the `fetchPosts` action and the `postsReducer`, but they don't seem to be triggered.

I've also checked the network requests in the browser dev tools, and the API call is successful, returning the expected data. However, the data is not being updated in the table.

I've searched for similar issues online, but most solutions suggest using `useEffect` with an empty dependency array, which I've already tried. I've also tried using `useCallback` to memoize the `fetchPosts` function, but that didn't work either.

Can someone help me identify the issue and provide a solution?

